document.getElementById('buttonCSV').addEventListener('click',function(){
  var Results = [labels,plot1y,plot2y,plot3y,plot4y];
  var CsvString = "";
  var d = new Date();
  var name = d.getDate().toString()+"//"+d.getMonth().toString()+"//"+d.getFullYear().toString();
  Results.forEach(function (RowItem, RowIndex) {
    RowItem.forEach(function (ColItem, ColIndex) {
      CsvString += ColItem + ',';
    });
    CsvString += "\r\n";
  });
  CsvString = "data:application/csv," + encodeURIComponent(CsvString);
  var x = document.createElement("A");
  x.setAttribute("href", CsvString);
  x.setAttribute("download", name+".csv");
  document.body.appendChild(x);
  x.click();
});